  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alamosa
  NWR outlines Refuge accomplishments during the 1994 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  public participation, and research and investigations. Refuge administration is
  outlined; information about personnel, youth programs, manpower programs, volunteer
  programs, funding, and safety is given. Habitat management is also covered; subjects
  include wetlands, grazing, pest control, and water rights. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
  scientific collections, animal control, and disease control. The public uses of
  the Refuge described in this report include outdoor classrooms, interpretive programs,
  hunting, fishing, outdoor recreation, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  equipment replacement, and computer systems. Cooperative programs are provided at
  the end. Refuge brochures and field guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
